description:
Spacewalk: Giant Leaps for Mankind

Science Documentary hosted by Euro News, published by Euronews in 2013 - English narration


Information
------------------------------

In this fascinating film from Euronews in collaboration with ESA, discover more about the first astronauts to walk in space and how the latest spacewalkers prepare to take on the challenge.

